import React from "react";
import "./intro.css";
import bg from "../../assets/bg.png"
import { Link } from "react-scroll";
import hireMe from "../../assets/hireMe.png"
import "bootstrap/dist/css/bootstrap.min.css"; 

const Intro = () => {
    return (
        <section id="intro" className="container-fluid">
            <div className="row introContent">
                <div className="col-md-6">
                    <span className="hello">Hello</span>
                    <span className="introText">I'm <span className="introName">Priyanshu</span><br />Website Developer </span>
                    <p className="introPara">I am a skilled web designer with experience in<br/> creating visually appealing and user-friendly websites.</p>
                    <Link><button className="btn btn-primary"><img className="btnImg" src={hireMe} alt="btnImg" />Hire Me</button></Link>
                </div>
                <div className="col-md-6">
                    <img className="img-fluid bg" src={bg} alt="bg" />
                </div>
            </div>
        </section>
    );
};

export default Intro;
